import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Competition() {
  const [selectedGroups, setSelectedGroups] = useState([]);

  useEffect(() => {
    axios
      .get('http://localhost:8000/api/selectedGroups')
      .then((response) => {
        setSelectedGroups(response.data);
      })
      .catch((error) => {
        console.error('Error fetching selected groups:', error);
      });
  }, []);

  

  return (
    <div>
      <h1>Competition</h1>
      <ul>
      {selectedGroups.map((group) => {
  const groupData = JSON.parse(group);

  return (
    <li key={groupData.joukkue_id}>
      <h2>Group {groupData.joukkue_id}</h2>
      <p>Team Name: {groupData.joukkue_nimi}</p>
      <p>Members: {groupData.jäsenet}</p>
      <p>City: {groupData.kaupunki}</p>
      <p>Participation Number: {groupData.osallistumis_nro}</p>
      <p>Semifinalist: {groupData.semifinalist}</p>
      <p>Finalist: {groupData.finalist}</p>
    </li>
  );
})}


      </ul>
    </div>
  );
}

export default Competition;
